Positive review:
Room - The place that we stayed was in 4th floor in room 421. The room was just fantastic. The place is clean & spacious; The room stay been provided with mineral waters & workable coffee machine;
The coffee machine is just amazing & complimentary from hotel to use without any surcharges; The room also comes with complimentary instant coffee, teas, milk & sugar;
Bed - The bed comes with lots of pillows & very handy for those have sinus flu health issue & can help relieve neck pain when sleeping;
Bathroom - Bathroom is all clean & don't have any old dirty stains; The shower heater functional & all bathroom amnesties provided frm daily housekeeping;
Heater & Air Condition - The air conditioning inside the room works all good as well as the heater if need to use it;
Breakfast - Breakfast was terrific; The breakfast buffet selections have lots of varieties & was not disappointment at all;
Location - Location of the hotel was decently good as we traveled from airport by bus (702) and the bus stopped right opposite Schoolhouse hotel which would be the nearest to the hotel. From the bus stopped location, we just have to walk about 10 minutes & will reach the hotel;
Amnesties- There is iron board in the room that comes in handy & also good sizeable hairdryer;
Transportation - The hotel is also quite nearby to the train station (Grand Canal Dock). It is a 10 to 15 minutes walk to the train station frm the hotel; For bus transportation, it is just 5 minutes walk & the 77A, 56A & most of the bus will pass through will bring you to the Dublin city; The traveling time is just 15 to 20 minutes to the city bus
Groceries- The hotel stay location is very convenient to get local groceries.
